import React from 'react';

function PopulateCharacters(user){
    console.log(user.characters);
    user.Characters.forEach( character => {

        return(
            <div className={`Character_${character.id}`}>
                <h1>Name: {character.name}</h1>
                <p>Physique: {character.physique}</p>

                <h2>Level: {character.level}</h2>
                <p>Current Experience: {character.current_experience}</p>
            </div>
        )
    })
    for( const character of user.characters){
        console.log(character.name);

        return(
            <div className={`Character_${character.id}`}>
                <h1>Name: {character.name}</h1>
                <p>Physique: {character.physique}</p>

                <h2>Level: {character.level}</h2>
                <p>Current Experience: {character.current_experience}</p>
            </div>
        )
    }
}

export default PopulateCharacters;
